    const [ player, setPlayer ] = useState(new Player());

    useEffect(() => {
        let p = new Player();
        p.setNome("mFL");
        p.setCor("azul");
        setPlayer(p);
    }, [] )

    return (<>
        <span>{player.getNe}</span>
    </>)
}

